          <link
            rel='preload'
            as='font'
            type='font/woff2'
            href='../fonts/pacifico-v17-latin-regular.woff2'
            crossOrigin='anonymous'
          ></link>

          <link
            rel='preload'
            as='font'
            type='font/woff2'
            href='../fonts/raleway-v18-latin-100.woff2'
            crossOrigin='anonymous'
          ></link>
          <link
            rel='preload'
            as='font'
            type='font/woff2'
            href='../fonts/raleway-v18-latin-700.woff2'
